import React from 'react'

const Inicio = () => {
  return (
    <div>
      <h1>
        Hola soy Manuel Lira y soy desarrollador web en Mexico,
        y ofresco mis servicios de programacion y desarrollo en todo
        tipo de proyectos web.
      </h1>
    </div>
  )
}

export default Inicio
